INSERT INTO `rs_messages` (`id`, `message`, `enabled`) VALUES
(2, '<h2>Rest easy...there are no events available to schedule.</h2><h2>Go referee some games yourself.</h2>', 0),
(3, '<h2 style=\"color:red\"><strong><em>26 Jan Update: &nbsp;Columbia Park is closed this weekend due to rains this week<br>\n\nExtra Playoffs will be rescheduled</em></strong></h2>\n\n<div style=\"width: 60%; margin: 0px auto; text-align:justify\">\n<h5>We received notification this morning that, as a result of last weeks unprecedented rainfall, the City of Torrance has closed all the fields at Columbia Park for this weekend. Unfortunately, the EXTRA Playoff matches scheduled for Saturday and Sunday are cancelled.&nbsp;</h5>\n<h5>Please thank your Referees for their service and let them know they are released from their assignments this weekend.</hr> \n<h5>We anticipate rescheduling the games for a later date and will notify the Area Referee Administrators when fields are confirmed.</h5>\n</div>', 0),
(4, '<h2 style=\"color:red\"><strong><em>26 Jan Update: &nbsp;Columbia Park is closed this weekend due to rains this week<br>\n\nExtra Playoffs have been rescheduled</em></strong></h2>\n\n<div style=\"width: 60%; margin: 0px auto; text-align:justify\">\n<h5>We received notification this morning that, as a result of last weeks unprecedented rainfall, the City of Torrance has closed all the fields at Columbia Park for this weekend. Unfortunately, the EXTRA Playoff matches scheduled for Saturday and Sunday are cancelled.&nbsp;</h5>\n<h5>Please thank your Referees for their service and let them know they are released from their assignments this weekend.</hr> \n<h5>The EXTRA PLAYOFFS have been rescheduled for the weekend of March 11 & 12 at Ab Brown in Riverside.  Updated match schedules & assignments will be posted when available.</h5>\n</div>', 0),
(5, '<div style=\"width: 60%; margin: 0px auto; text-align:justify\">\n<h5>Area Assignors, watch your email for your assignments at the Section 1 League Playoffs (25-26 Feb).</h5>\n<h5>All-Star/Extra Playoffs coming up 11-12 Mar.\n</div>', 1);
